import React from 'react';
import { StyledAlert } from '../../styles/StyledAlert';
import Button from '../Button/Button';

const Alert = ({id, isIE, title, text, callback, buttonTitle, position}) => (
    <StyledAlert id={id} isIE={isIE}>
        {title}
        {text}
        <Button isIE={isIE} callback={callback} title={buttonTitle} position={position} />
    </StyledAlert>
);

export default Alert;
